#
# View "saldosprodutos"
#

DROP VIEW IF EXISTS `saldosprodutos`;
CREATE
  ALGORITHM = UNDEFINED
  VIEW `saldosprodutos`
  AS
SELECT
  `grp`.`descricao`,
  `produtos`.`id`,
  `produtos`.`descricao` AS 'descprod',
  `produtos`.`precovista`,
  `produtos`.`codigointerno`,
  IFNULL(`sal`.`qtde`, 0) AS 'saldo',
  `produtos`.`codigobarras`,
  `produtos`.`status`,
  `sal`.`idlocal`,
  `sal`.`idEmpresa` AS 'idempresa',
  `produtos`.`descmax`,
  `produtos`.`estmin`,
  `uni`.`descricao` AS 'unidade'
FROM
  (((`produtos`
    JOIN `grupo` grp ON ((`grp`.`Id` = `produtos`.`id_grupo`)))
    JOIN `unidade` uni ON ((`uni`.`id` = `produtos`.`id_unidade`)))
    LEFT JOIN `saldos` sal ON ((`sal`.`Idprod` = `produtos`.`id`)));

#
# View "vwcolab"
#

DROP VIEW IF EXISTS `vwcolab`;
CREATE
  ALGORITHM = UNDEFINED
  VIEW `vwcolab`
  AS
SELECT
  `a`.`descricao` AS 'funcdesc',
  `b`.`status`,
  `b`.`id_funcao`,
  `b`.`id`,
  `b`.`nome`,
  `b`.`comissao`
FROM
  (`colaborador` b
    LEFT JOIN `funcao` a ON (((`a`.`Id` = `b`.`id_funcao`) AND (`a`.`status` = 'Ativo'))))
WHERE
  (`b`.`status` = 'Ativo');
